function Results(props){
  let total = props.physics + props.chemistry + props.maths
  let per = total*100/450
  let results=""
  if (per>=90){
    results="A+"
  }
  if (per>=80 && per<90){
    results="A"
  } 
  if (per>=70 && per<80){
    results="B"
  }
  if (per>=60 && per<70){
    results="C"
  }
  if (per<60){
    results="Fail"
  }
    return(
        <>
            <h2><center>Result Sheet</center></h2>
            <h3>Name: {props.name}</h3>
            <table>
                <tr>
                    <td>Total Marks</td>
                    <td><b>{total}</b></td>
                </tr>
                <tr>
                    <td><b>Percentage</b></td>
                    <td><b>{per}%</b></td>
                </tr>
                <tr>
                    <td>Result</td>
                    <td> <b>{results}</b></td>
                </tr>
            Physics: {props.physics}
            Chemisty: {props.chemistry}
            maths: {props.maths}
          
            </table>
        </>
    );
}
export default Results;
